import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import { Dashboard } from './views/Dashboard';
import { Header } from './views/Header';
import axios, { AxiosResponse } from 'axios';
import { useState, useEffect } from 'react';
import React from 'react';
import { Login } from './views/Login';
import { getCurrentUser } from './resources';
import { CompanyForm } from './views/CompanyForm';

function App() {
    const [companies, setCompanies] = useState<
        { name: string; city: string; speciality: string }[] | []
    >();
    console.log(companies);
    useEffect(() => {
        axios.get('api/company').then(
            (
                r: AxiosResponse<{
                    companies: { name: string; city: string; speciality: string }[];
                }>
            ) => {
                console.log(r);
                setCompanies(r.data.companies);
            }
        );
    }, []);
    return (
        <>
            <Router>
                <div className="container">
                    <Header />
                    <Routes>
                        <Route path="/" element={<Dashboard companies={companies} />} />
                        <Route path="/addCompany" element={<CompanyForm />} />
                    </Routes>
                </div>
            </Router>
            <ToastContainer />
        </>
    );
}

export default App;
